        \           that it obtains from persons who use its website. Please read
        this statement to\r\n            learn what information Council collects about
        you, why it is collected and what\r\n            is done with it.</p>\r\n
        \       <br />\r\n        <br />\r\n        <p class=\"subheading\">\r\n            <b>Collecting
        Personal Information</b></p>\r\n        <p class=\"bodycopy\">\r\n            In
        completing any of the forms available on this site you will provide Fairfield\r\n
        \           City Council with \"personal information\". This is defined in
        the Privacy and Personal\r\n            Information Protection Act 1998 (\"PPIPA\")
        to be \"information or an opinion about\r\n            an individual whose
        identity is apparent or can reasonably be ascertained from the\r\n            information
        or opinion\". Personal information collected by Council will include\r\n            your
        name and any other information included in the forms.</p>\r\n        <p class=\"bodycopy\">\r\n
        \           Further, when you visit Council's website the following information
        is recorded\r\n            for statistical purposes:</p>\r\n        <ul>\r\n
        \           <li class=\"bodycopy\">The address of your server;</li>\r\n            <li
        class=\"bodycopy\">The top-level domain from which you accessed the Internet
        (such\r\n                as .com,.org,. gov, .edu, .au, .nz, etc.);</li>\r\n
        \           <li class=\"bodycopy\">The type of browser used;</li>\r\n            <li
        class=\"bodycopy\">The date and time of your visit to the site;</li>\r\n            <li
        class=\"bodycopy\">The pages you visited and the documents you downloaded;</li>\r\n
        \           <li class=\"bodycopy\">The links you followed to come to and leave
        the site;</li>\r\n            <li class=\"bodycopy\">Any other information
        that is recorded</li>\r\n            <li class=\"bodycopy\">This information
        is used to create reports to tell Council the\r\n                number of
        visitors to the site, what areas are most visited, what areas are least\r\n
        \               visited and technical design information such as broken links.
        This information\r\n                is used to assist Council in making the
        site more useful to visitors.</li>\r\n        </ul>\r\n        <p class=\"bodycopy\">\r\n
        \           Personal information collected from you is held and used by Council
        as permitted\r\n            by Privacy and Personal Information Protection
        Act 1998 (\"PPIPA\"). Under PPIPA you\r\n            are entitled to be informed
        of:</p>\r\n        <ul>\r\n            <li class=\"bodycopy\">the fact that
        personal information is being collected;</li>\r\n            <li class=\"bodycopy\">the
        name and address of the agency collecting and holding the information;</li>\r\n
        \           <li class=\"bodycopy\">the purposes for which the information
        is being collected;</li>\r\n            <li class=\"bodycopy\">the persons
        and bodies to whom the information will be disclosed;</li>\r\n            <li
        class=\"bodycopy\">whether the provision of the information is mandatory or
        voluntary;</li>\r\n            <li class=\"bodycopy\">the consequences (if
        any) of not providing the information; and</li>\r\n            <li class=\"bodycopy\">your
        right under PPIPA to apply to have access to your information\r\n                or
        to have it corrected.</li>\r\n        </ul>\r\n        <p class=\"bodycopy\">\r\n
        \           Council has various functions under the Environmental Planning
        and Assessment Act,\r\n            1979, the Local Government Act 1993 and
        other legislation. Personal information\r\n            is collected to enable
        Council to perform the functions under these Acts. Under\r\n            PPIPA,
        other agencies (particularly law enforcement agencies) may have the right\r\n
        \           to gain access to personal information about you that Council
        holds. Indeed, some\r\n            agencies (particularly law enforcement
        agencies) have legal authority to inspect\r\n            our Internet Service
        Providers' logs and obtain your address if required for an\r\n            official
        investigation. Further, Council records may be available for public inspection\r\n
        \           and copying, including under the Government Information (Public
        Access) Act 2009.</p>\r\n        <p class=\"bodycopy\">\r\n            At
        the request of an individual to whom personal information held by Council
        relates,\r\n            Council must provide the individual with access to
        the information. Council must,\r\n            at the request of an individual
        to whom personal information held by Council relates,\r\n            make
        appropriate amendments to ensure that the personal information is, among other\r\n
        \           things, accurate.</p>\r\n        <br />\r\n        <br />\r\n
